import React from 'react';
import { useHistory } from 'react-router-dom';

const Home = () => {
  const history = useHistory(); // Hook for navigation

  const goToTopTracks = () => {
    history.push('/top-tracks'); // Navigate to TopTracksPage
  };

  return (
    <div>
      <h1>Home Page</h1>
      <p>Welcome to your Spotify data dashboard!</p>
      <button onClick={goToTopTracks}>View Top Tracks</button>
    </div>
  );
};

export default Home;
